import React from "react";
import {Consumer} from "./Context"

export default function Home(props){
    return(
        <Consumer>
            {(context) => {
                return(
                    <div className="homeContainer">
                        <div className="movieTitle">
                            Movie Title
                        </div>
                        <div>
                            Movie Image
                        </div>
                    </div>
                )
            }}
        </Consumer>
    )
}
